import { FuseLoadable } from "owp/@fuse";
import { authRoles } from "owp/auth";

export const Error500PageConfig = {
    settings: {
        layout: {
            config: {},
        },
    },
    //auth: authRoles.user,
    routes: [
        {
            path: '/pages/errors/error-500',
            component: FuseLoadable({
                loader: () => import('./Error500Page'),
            }),
        },
    ],
};
